// dex.js
const generationLookup = {
    all: { start: 1, end: 1010 }, // Update the end ID to the last Pokémon in Gen 9
    1: { start: 1, end: 151 },
    2: { start: 152, end: 251 },
    3: { start: 252, end: 386 },
    4: { start: 387, end: 494 },
    5: { start: 495, end: 649 },
    6: { start: 650, end: 721 },
    7: { start: 722, end: 809 },
    8: { start: 810, end: 905 },
    9: { start: 906, end: 1010 } // Generation 9
};

function getCurrentGeneration(pokemonId) {
    for (const generation in generationLookup) {
        const { start, end } = generationLookup[generation];
        if (pokemonId >= start && pokemonId <= end) {
            return parseInt(generation);
        }
    }
    return 0;
}

// Function to get the region name from the generation number
function getRegionFromGeneration(generation) {
    switch (generation) {
        case 1:
            return 'Kanto';
        case 2:
            return 'Johto';
        case 3:
            return 'Hoenn';
        case 4:
            return 'Sinnoh';
        case 5:
            return 'Unova';
        case 6:
            return 'Kalos';
        case 7:
            return 'Alola';
        case 8:
            return 'Galar';
        case 9:
            return 'Paldea';
        default:
            return 'Other';
    }
}

// Function to get the color based on Pokémon type
function getTypeColor(type) {
    switch (type) {
        case 'normal':
            return '#A8A77A';
        case 'fighting':
            return '#C22E28';
        case 'flying':
            return '#A98FF3';
        case 'poison':
            return '#A33EA1';
        case 'ground':
            return '#E2BF65';
        case 'rock':
            return '#B6A136';
        case 'bug':
            return '#A6B91A';
        case 'ghost':
            return '#735797';
        case 'steel':
            return '#B7B7CE';
        case 'fire':
            return '#EE8130';
        case 'water':
            return '#6390F0';
        case 'grass':
            return '#7AC74C';
        case 'electric':
            return '#F7D02C';
        case 'psychic':
            return '#F95587';
        case 'ice':
            return '#96D9D6';
        case 'dragon':
            return '#6F35FC';
        case 'dark':
            return '#705746';
        case 'fairy':
            return '#D685AD';
        default:
            return '#B7B7B7';
    }
}

// Function to display Pokémon details on the page
function displayPokemonDetails(details) {
    const nameElement = document.getElementById('pokemon-name');
    const typesElement = document.getElementById('pokemon-types');
    const imageElement = document.getElementById('pokemon-image');
    const statsContainer = document.getElementById('pokemon-stats');
    const abilitiesContainer = document.getElementById('pokemon-abilities');
    const physicalCharacteristicsContainer = document.getElementById('pokemon-physical');
    const miscellaneousContainer = document.getElementById('pokemon-misc');

    nameElement.textContent = details.english_name;

    // Display types
    const primaryTypeTagElem = document.createElement('span');
    primaryTypeTagElem.classList.add('type-tag');
    primaryTypeTagElem.textContent = details.primary_type.toUpperCase();
    primaryTypeTagElem.style.backgroundColor = getTypeColor(details.primary_type.toLowerCase());
    typesElement.appendChild(primaryTypeTagElem);

    if (details.secondary_type) {
        const secondaryTypeTagElem = document.createElement('span');
        secondaryTypeTagElem.classList.add('type-tag');
        secondaryTypeTagElem.textContent = details.secondary_type.toUpperCase();
        secondaryTypeTagElem.style.backgroundColor = getTypeColor(details.secondary_type.toLowerCase());
        typesElement.appendChild(secondaryTypeTagElem);
    }

    // Display image
    imageElement.src = `https://res.cloudinary.com/dsa5iolcx/image/upload/v1723147567/pokemon/images-v3/${details.english_name.toLowerCase()}.png`;

    // Display stats
    const statKeys = ['HP', 'ATK', 'DEF', 'SA', 'SD', 'SPD', 'TTL'];
    statKeys.forEach(key => {
        const statElem = document.createElement('div');
        const value = details[key] === "" ? "None" : details[key];
        statElem.textContent = `${key}: ${value}`;
        statsContainer.appendChild(statElem);
    });

    // Display abilities
    const abilitiesKeys = ['Ability I', 'Ability II', 'Hidden Ability'];
    abilitiesKeys.forEach(key => {
        const abilityElem = document.createElement('div');
        const value = details[key] === "" ? "None" : details[key];
        abilityElem.textContent = `${key}: ${value}`;
        abilityElem.classList.add('ability-box'); // Add the class for styling
        abilitiesContainer.appendChild(abilityElem);
    });

    // Display physical characteristics
    const physicalKeys = ['Height (ft)', 'Height (m)', 'Weight (lbs)', 'Weight (kg)'];
    physicalKeys.forEach(key => {
        const physicalElem = document.createElement('div');
        const value = details[key] === "" ? "None" : details[key];
        physicalElem.textContent = `${key}: ${value}`;
        physicalCharacteristicsContainer.appendChild(physicalElem);
    });

    // Display miscellaneous information
    const miscellaneousKeys = [
        'Experience Value', 'Catch Rate', 'Experience Growth', 'Base Friendship',
        'Pokedex Color', 'Gender Ratio', 'Egg Cycles', 'Egg Group I', 'Egg Group II', 'Evolution Method'
    ];

    miscellaneousKeys.forEach(key => {
        const miscElem = document.createElement('div');
        const value = details[key] === "" ? "None" : details[key];
        miscElem.textContent = `${key}: ${value}`;
        miscellaneousContainer.appendChild(miscElem);
    });
}


// Main function to handle the display of Pokémon details
function displayDex(id) {
    const pokemonDetails = pokemonData.find(pokemon => pokemon.national_number === parseFloat(id));

    console.log("Pokemon Details:", pokemonDetails);

    if (pokemonDetails) {
        displayPokemonDetails(pokemonDetails);
    } else {
        console.error('Pokémon details not found.');
    }
}

// Execute the code when the page loads
document.addEventListener('DOMContentLoaded', () => {
    const urlParams = new URLSearchParams(window.location.search);
    const dexId = urlParams.get('id');

    console.log("Dex ID:", dexId);

    if (dexId) {
        displayDex(dexId);
    }
});
